data.value:
return (function(argsArray) {
	var y = argsArray[0], m = argsArray[1], d = argsArray[2];
  return new Date(y,m,d).toLocaleDateString();
}(arguments));

return (function(window, argsArray) {
  var
    date = argsArray[1],
    id = argsArray[0],
    element = window.document.getElementById(id);
  if(!element) return false;

  element.setAttribute('value', date);

  var ev = window.document.createEvent('Event');
  ev.initEvent('change', true, true);
  element.dispatchEvent(ev);

	return true;
}(window, arguments));
